bool collides(TileEngine::GameObject& object, int x, int y) {
  for (int y1 = (object.pos.y + 1) / 16; y1 < (object.pos.y + object.size.y - 1) / 16; y1++) {
    for (int x1 = (object.pos.x + 1) / 16; x1 < (object.pos.x + object.size.x - 1) / 16; x1++) {
      if (TileEngine::getTile(x1, y1) != 0 && atlases[0].collide(TileEngine::getTile(x1, y1) - 1)) return true;
    }
  }
  return !inRange((vec2i)object.pos, vec2i(-1), TileEngine::levelSize() * 16 - object.size + 1);
}

bool moveObject(TileEngine::GameObject& object, float x, float y) {
  bool collided = false;
  object.pos += vec2f(x, y);
  while (collides(object, sign(x), sign(y))) collided = true, object.pos -= vec2f(sign(x), sign(y)) * 0.5;
  return collided;
}
