void load() {
  TileEngine::loadAtlases(textures, atlases);
  Scripts::load();
}

TileEngine::Component* loadComponent(uint16_t type, const uint8_t*& data) {
  enum ComponentType : uint16_t {
    // System
    LEVEL_TRANSITION,
    // AI
    SUPER_MARIO
  };

  if (type == LEVEL_TRANSITION) {
    return new LevelTransition(TileEngine::loadLevelIndex(data), vec2i(TileEngine::loadInt(data), TileEngine::loadInt(data)));
  } else if (type == SUPER_MARIO) {
    return new Mario();
  }
  return nullptr;
}

void update() {
  if (nextLevel != -1) return;
  if (!UI::dialog) TileEngine::update();
}

void draw() {
  oled::fillScreen(0x04D6);
  if (nextLevel != -1) return;
  TileEngine::draw();
  if (UI::dialog) UI::drawDialog();
}

void start() {
  if (!SD.exists(savepath + "/mario")) SD.mkdir(savepath + "/mario");
  TileEngine::begin(textures, levels, loadComponent, atlases);
  nextLevel = g_State.mario.level;
  g_State.mario.level = -1;
  if (!g_State.mario.princessLost) Script::addThread(Scripts::princessScreaming), g_State.mario.princessLost = true;

  game = Game(update, draw, save);
}
